    false,nt"url": null,nt"notes": "NODC accession 0103941 includes physical
    and underway data collected aboard the ENDEAVOR during cruise EN480 in the Caribbean
    Sea and North Atlantic Ocean from 2010-07-13 to 2010-07-23. These data include CURRENT
    SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
    instruments used to collect these data include ADCP and GPS. These data were collected
    by UNIVERSITY OF RHODE ISLAND; GRADUATE SCHOOL OF OCEANOGRAPHY as part of Budget
    and Fluxes of Black Carbon in South Atlantic Sediments. The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling
    Deck to Repository (R2R) program. The ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
